import React, { useEffect, useState } from "react";
import "./Circle.css";

export default function Circle() {
  const [user, setUser] = useState([]);
  useEffect(() => {
    fetch("https://online.ntnu.no/api/v1/users/?rfid=0260434848")
      .then((res) => res.json())
      .then((res) => setUser(res.results[0]));
  }, []);

  const r = 700 / (Math.PI * 2);
  const d = r * 2;
  const y = (250 - 222.81692) / 2;
  const pathData = [
    "M",
    250 / 2,
    y,
    "a",
    r,
    r,
    0,
    0,
    1,
    0,
    d,
    "a",
    r,
    r,
    0,
    0,
    1,
    0,
    -d,
  ];

  const number_people = [[700/12, 700], [700/12*2, 700]]
  console.log(pathData);

  return (
    <div className="container">
      <svg height="250" width="250" className="circle">
        <path
          d={pathData.join(" ")}
          fill="transparent"
          stroke="#0D5474"
          strokeWidth="3"
          strokeDasharray={number_people[1]}
        ></path>
        <text x="50%" y="50%" fill="white" textAnchor="middle">
          {user.first_name} {user.last_name}
        </text>
      </svg>
    </div>
  );
}
